import React from "react";
import styled from "styled-components";

const Logo = styled.figure``;
function Header() {
  return (
    <div>
      <Logo>
        <img
          src="/assets/logo.webp"
          srcSet="/assets/logo@2x.webp 2x , /assets/logo@3x.webp 3x"
          alt="김과장컨설팅"
        />
      </Logo>
    </div>
  );
}

export default Header;
